import React, { useState } from "react";

function BasicCounter() {
  const [count, setCount] = useState(0); // ค่าเริ่มต้นเปลี่ยนได้ เช่น 10

  return (
    <div className="p-4 bg-white rounded-lg shadow-md text-center">
      <h2 className="text-xl font-bold mb-3">Counter: {count}</h2>
      <div className="space-x-2">
        <button onClick={() => setCount(count + 1)} className="btn">+1</button>
        <button onClick={() => setCount(count - 1)} className="btn">-1</button>
        <button onClick={() => setCount(count + 5)} className="btn">+5</button>
        <button onClick={() => setCount(count + 10)} className="btn">+10</button>
      </div>
    </div>
  );
}

export default BasicCounter;
